import React from "react";

export default () => {
  <section className="container-fluid">
    <div className="row m-2-hor">
      <div className="col-md-6 pt-5">
        <div className="col-home">
          <div className="thumb">
            <img src="./img/nature4.jpg" className="img-fluid" alt="#" />
          </div>
        </div>
      </div>
    </div>
  </section>;
};
